import React from 'react'
const ErrorPage = ()=>{
    return(
        <>
        <div class="contain">
			<div class="contain2">
				<div class="title text-danger">404 Sorry, the page you viewed could not be found! </div>
			</div>
		</div>
        </>
    )
}

export default ErrorPage
